import React from 'react';

const Navigation = ({ onNext, onPrevious }) => {
    return (
        <div className="flex justify-between mt-4">
            <button 
                className="bg-blue-500 text-white px-4 py-2 rounded" 
                onClick={onPrevious}
            >
                Previous
            </button>
            <button 
                className="bg-blue-500 text-white px-4 py-2 rounded" 
                onClick={onNext}
            >
                Next
            </button>
        </div>
    );
};

export default Navigation;
